import React from 'react';
import Logo from '../logoHenry.png'
import SearchBar from './SearchBar.jsx';
import './Nav.css';

function Nav({onSearch}) {
  return (
    <nav  style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "10px",
       backgroundColor: "blue",
        
    }}>
      
     <SearchBar onSearch={onSearch} />
    </nav>
  );
};

export default Nav;
